import React from 'react';
import IkaCoin from '../src/services/IkaCoin';
import Account from '../src/services/Account';
import Transfer from '../src/services/Transfer';

import './App.css';


function App() {

  return (
    <>
      <h1 className=".App">IkaCoin</h1>
      <IkaCoin></IkaCoin>
      <Account></Account>
      <Transfer></Transfer>
    </>
  );
}

export default App;
